import React from 'react';
import { useState, useEffect } from 'react';

function Shop(props) {
  return (
    <div id='Shop'>
      <p>Purchase Pie</p>
      <p>1000 Pies = 1$</p>
      <p>10000 Pies = 10$</p>
      <p>100000 Pies = 100$</p>
      <p>Purchase items</p>
      <p>1 Poker = 1$</p>
      <p>1 Baker = 3$</p>
      <p>1 Cafe = 5$</p>
      <p>1 Factory = 10$</p>
    </div>
  )
}

export default Shop
